       const response = await fetch('http://127.0.0.1:8000/elevator' , {
            method : 'GET',
            headers: {
                accept: 'application/json'
            }
        });

        if(!response.ok){
            throw new Error('Error status :  ${response.status}');
        }
        const result = await response.json();
        return(
            <div>
                <h5>result content :</h5>
                <script type="application/json"> {result}</script>
            </div>

        )


   }catch(err){
       console.log(err)

       return (
        <h3>error</h3>
    );
